export function getPreviewerType(type) {
	if (!type.category) return null;
	return typeInfo[type.category].info.previewerType;
}

export function getFileType(extension) {
	if (!extension || !fileTypes[extension.split('.')[1]]) return { info: typeInfo['default'].info };
	let type = fileTypes[extension.split('.')[1]];
	let typeinfo = typeInfo[type.mime.split('/')[0]];
	return { mime: type.mime, info: typeinfo ? typeinfo.info : null }
}

export function getExtensionByMime(mime) {
	let _mime = mime.split('/');
	return Object.entries(fileTypes).map(t => {
		if (_mime[1] !== '*') {
			if (t[1].mime == mime)
				return t[0]
		}
		else {
			if ((t[1].mime.split('/')[0] == _mime[0] && t[1].supported && !t[1].category) || (t[1].category == _mime[0] && t[1].supported))
				return t[0]
		}
	})
}

export function getMime(extension) {
	if (!extension) return null;
	let result = fileTypes[extension];
	return result ? result.mime : null;
}


